import React from 'react';
import './Cards.css';
import CardItem from './CardItem';

function Cards() {
  return (
    <div className='cards'>
      <h1>Check out these EPIC Destinations!</h1>
      <div className='cards__container'>
        <div className='cards__wrapper'>
          <ul className='cards__items'>
            <CardItem
              src='images/bartender.jpeg'
              text='No need to search the vast internet scavenging for the perfect beat. At Thessian Sound you’ll find exactly what you’re looking for. We have beats for every genre, mood and style.'
              label='Beat Store'
              path='/services'
            />
            <CardItem
              src='images/like-that.jpeg'
              text='We make it really easy for you to interact with our engineers and for you to know the current status of your projects from the moment you submit your songs and give us the go-ahead to start working.
              You will have your personalized account whereby you’ll be able to access all your beats, and upload all your files for mixing and mastering along with production notes if applicable.'
              label='Uuser Library'
              path='/sign-up'
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
